variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2034108","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"2033757"},"glyph":{"id":"2033944"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2033946"},"nonselection_glyph":{"id":"2033945"},"view":{"id":"2033948"}},"id":"2033947","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"2033835"},"glyph":{"id":"2033836"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2033838"},"nonselection_glyph":{"id":"2033837"},"view":{"id":"2033840"}},"id":"2033839","type":"GlyphRenderer"},{"attributes":{},"id":"2033746","type":"SaveTool"},{"attributes":{"data":{"Close":{"__ndarray__":"exSuR+GqVUDXo3A9CrdVQDMzMzMzo1VA9ihcj8KlVUAAAAAAAKBVQGZmZmZmtlVArkfhehTuVUDNzMzMzDxWQHsUrkfhWlZAcT0K16NwVkBxPQrXo3BWQDMzMzMzw1ZAMzMzMzPDVkCamZmZmZlWQEjhehSux1ZAZmZmZmY2V0Bcj8L1KJxXQNejcD0KN1dAMzMzMzNTV0CPwvUoXP9WQIXrUbge9VZAhetRuB41V0AK16NwPfpWQOF6FK5HEVdA9ihcj8L1VkD2KFyPwtVWQIXrUbgelVZArkfhehS+VUAzMzMzM9NVQK5H4XoUzlVAXI/C9Sh8VUCkcD0K10NVQK5H4XoUjlVAXI/C9Sh8VUA9CtejcG1VQM3MzMzMvFVAuB6F61H4VUCF61G4HgVWQK5H4XoUPlZACtejcD3aVUAAAAAAACBWQHsUrkfhKlZAcT0K16NQVkAK16NwPbpWQJqZmZmZ2VZAzczMzMzcVkCkcD0K1xNXQIXrUbgeNVdAuB6F61EYV0Bcj8L1KAxXQGZmZmZmhldAFK5H4XqUV0DXo3A9CqdXQOF6FK5HUVdApHA9CtfDWkBI4XoUrjdbQDMzMzMz01pA9ihcj8L1WkBI4XoUrndaQAAAAAAAAFtApHA9CtfDWkBxPQrXo2BbQHsUrkfhKltAXI
